import React, { useState } from "react";
// import "bootstrap/dist/css/bootstrap.min.css";

const LoginForm = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [role, setRole] = useState('patient'); 

    function handleLogin(e) {
        e.preventDefault();
        const user = { email, password, role };
        console.log(user);
    }

    return (
        <div className="loginform card">
            <div className="card-body">
                <h2 className="card-title p-3">Welcome Back!</h2>
                <form>
                    <div className="form-floating mb-3">
                        <input type="email"
                            id="floatingInput"
                            name="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            placeholder="Enter your email"
                            required
                            autoComplete="off"
                            className="form-control" />
                        <label htmlFor="floatingInput">Email</label>
                    </div>
                    <div className="form-floating mb-3">
                        <input type="password"
                            id="floatingPassword"
                            name="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            placeholder="Enter your Password"
                            required
                            autoComplete="off"
                            className="form-control" />
                        <label htmlFor="floatingPassword">Password</label>
                    </div>
                    <div className="mb-3 p-2">
                        <label className="form-label d-block fw-bold text-start">Select Role:</label>
                        <div className="d-flex align-items-center">
                            <input type="radio" 
                                id="admin" 
                                name="role" 
                                value="admin"
                                checked={role === "admin"} 
                                onChange={(e) => setRole(e.target.value)}
                                className="me-1" />
                            <label htmlFor="admin" className="me-3">Admin</label>

                            <input type="radio" 
                                id="patient" 
                                name="role" 
                                value="patient"
                                checked={role === "patient"} 
                                onChange={(e) => setRole(e.target.value)}
                                className="me-1" />
                            <label htmlFor="patient" className="me-3">Patient</label>

                            <input type="radio" 
                                id="doctor" 
                                name="role" 
                                value="doctor"
                                checked={role === "doctor"} 
                                onChange={(e) => setRole(e.target.value)}
                                className="me-1" />
                            <label htmlFor="doctor">Doctor</label>
                        </div>
                    </div>
                    <div className="col-12 mt-4">
                        <button type="submit" className="btn btn-success w-100" onClick={handleLogin}>Login</button>
                    </div>
                    <br />
                    <p className="form-text">
                        <a href="/LoginForm" className="form-link text-black">Forgot Password?</a>
                    </p>
                    <p className="form-text">
                        Don't have an account? <a href="/register" className="form-link text-black">Create an Account</a>
                    </p>
                </form>
            </div>
        </div>
    );
}

export default LoginForm;
